    public List<WaiFuCBSJ> getRemoveWaiFuCBSJList(List<WaiFuCBSJ> waiFuCBSJList, String account) {
        if (waiFuCBSJList == null || account == null) {
            return null;
        }

        List<WaiFuCBSJ> allWaiFuCBSJs = getAllWaiFuCBSJList(account);
        for (WaiFuCBSJ waiFuCBSJ : waiFuCBSJList) {
            for (WaiFuCBSJ waiFuCBSJ1 : allWaiFuCBSJs) {
                if (waiFuCBSJ1.getI_RenWuBH() == waiFuCBSJ.getI_RenWuBH()) {
                    allWaiFuCBSJs.remove(waiFuCBSJ1);
                    break;
                }
            }
        }
        return allWaiFuCBSJs;

    }

