    public List<WaiFuCBSJ> getAllWaiFuCBSJList(String account) {
        if (account == null) {
            return null;
        }

        QueryBuilder qb = this.queryBuilder();
        qb.where(Properties.S_CHAOBIAOY.eq(account));
        qb.orderAsc(Properties.I_CENEIXH);
        return qb.list();
    }


    // filterType: -1 -> all; 0 -> weichao; 1-> yichao_weishangchuan; 2 -> yichao_yishangchuan
    // 3 -> yichao
    public List<WaiFuCBSJ> getWaiFuCBSJList(String account, int filterType) {
        if (account == null) {
            return null;
        }

        QueryBuilder qb = this.queryBuilder();
        if (filterType == -1) { // all
            qb.where(Properties.S_CHAOBIAOY.eq(account));
        } else if (filterType == 0) { // weichao
            qb.where(Properties.S_CHAOBIAOY.eq(account),
                    Properties.I_CHAOBIAOBZ.notEq(1));
        } else if (filterType == 1) { // yichao_weishangchuan
            qb.where(Properties.S_CHAOBIAOY.eq(account),
                    Properties.I_CHAOBIAOBZ.eq(1),
                    Properties.I_ShangChuanBZ.eq(0));
        } else if (filterType == 2) { // yichao_yishangchuan
            qb.where(Properties.S_CHAOBIAOY.eq(account),
                    Properties.I_CHAOBIAOBZ.eq(1),
                    Properties.I_ShangChuanBZ.eq(2));
        } else if (filterType == 3) { // yichao
            qb.where(Properties.S_CHAOBIAOY.eq(account),
                    Properties.I_CHAOBIAOBZ.eq(1));
        } else {
            qb.where(Properties.S_CHAOBIAOY.eq(account));
        }

        qb.orderAsc(Properties.I_CENEIXH);
        return qb.list();
    }


    public List<WaiFuCBSJ> getWaiFuCBSJs(List<String> cids) {
        if (cids == null) {
            return null;
        }

        QueryBuilder qb = this.queryBuilder();
        qb.where(Properties.S_CID.in(cids));
        qb.orderAsc(Properties.I_CENEIXH);
        List<WaiFuCBSJ> list = qb.list();
        return list;
    }


    public void updateWaiFuCBSJ(WaiFuCBSJ waiFuCBSJ) {
        if (waiFuCBSJ == null) {
            return;
        }

        update(waiFuCBSJ);
    }

    /**
     * 根据CID(用户号)获取本地数据对应的单条外复任务
     *
     * @param S_CID
     * @return WaiFuCBSJ实体
     */
    public WaiFuCBSJ getWaiFuCBSJ(int taskId, String cH, String S_CID) {
        if (S_CID == null || cH == null) {
            return null;
        }
        QueryBuilder qb = this.queryBuilder();
        qb.where(Properties.S_CID.eq(S_CID), Properties.I_RenWuBH.eq(taskId), Properties.S_CH.eq(cH));
        List<WaiFuCBSJ> waiFuCBSJlist = qb.list();
        if ((waiFuCBSJlist == null) || (waiFuCBSJlist.size() <= 0)) {
            return null;
        }
        return waiFuCBSJlist.get(0);
    }


    public WaiFuCBSJ getPreviousWaiFuCBSJ(String account, String cid) {
        if (account == null || cid == null) {
            return null;
        }

        List<WaiFuCBSJ> waiFuCBSJList = getAllWaiFuCBSJList(account);
        int index = -1;
        for (int i = 0; i < waiFuCBSJList.size(); i++) {
            if (waiFuCBSJList.get(i).getS_CID().equals(cid)) {
                index = i;
                break;
            }
        }
        if (index == 0) {
            return null;
        } else {
            return waiFuCBSJList.get(index - 1);
        }
    }


    // ok
    public WaiFuCBSJ getNextWaiFuCBSJ(String account, String cid) {
        if (cid == null || account == null) {
            return null;
        }
        List<WaiFuCBSJ> waiFuCBSJList = getAllWaiFuCBSJList(account);
        int index = -1;
        for (int i = 0; i < waiFuCBSJList.size(); i++) {
            if (waiFuCBSJList.get(i).getS_CID().equals(cid)) {
                index = i;
                break;
            }
        }
        if (index == waiFuCBSJList.size() - 1) {
            return null;
        } else {
            return waiFuCBSJList.get(index + 1);
        }

    }


